import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
function Nav(){
    return (
        <div className="Nav-bar">
            <div>
            <Row>
                <Col xs={{ order: 'last' }}>First, but last</Col>
                <Col xs>Second, but unordered</Col>
                <Col xs={{ order: 'first' }}>Third, but first</Col>
            </Row>
            </div>


        </div>
    )
}

export default Nav;
